--
-- Table structure for table `events`
--

DROP TABLE IF EXISTS `events`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `events` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `unit_id` bigint unsigned NOT NULL COMMENT 'Идентификатор юнита',
  `creator_id` bigint unsigned NOT NULL COMMENT 'автор сообщения',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Название события',
  `details` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `repeat` tinyint(1) DEFAULT NULL COMMENT 'Нужно ли повторять событие',
  `repeat_interval` time DEFAULT NULL COMMENT 'Периодичность повторения',
  `repeat_until` datetime DEFAULT NULL COMMENT 'Дата окончанию для повторения',
  `starts_at` datetime NOT NULL COMMENT 'Дата начала события',
  `ends_at` datetime DEFAULT NULL COMMENT 'Дата окончания события',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `events_unit_id_fk` (`unit_id`),
  KEY `events_creator_id_fk` (`creator_id`),
  KEY `name_idx` (`name`),
  CONSTRAINT `events_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `events_unit_id_fk` FOREIGN KEY (`unit_id`) REFERENCES `units` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='События';
/*!40101 SET character_set_client = @saved_cs_client */;

