--
-- Table structure for table `media`
--

DROP TABLE IF EXISTS `media`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `media` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `creator_id` bigint unsigned DEFAULT NULL COMMENT 'Идентификатор пользователя',
  `target_type` enum('comment','document','event','post','todo_list','todo','user') CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'тип данных',
  `target_id` bigint unsigned NOT NULL COMMENT 'Идентификатор элемента',
  `media_type` enum('photo','video','audio','avatar') NOT NULL COMMENT 'тип данных',
  `filename` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Ссылка на файл',
  `size` bigint unsigned DEFAULT NULL COMMENT 'Размер файла',
  `metadate` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin COMMENT 'Метаданные',
  `file_path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Путь к файлу',
  PRIMARY KEY (`id`),
  KEY `media_creator_id_fk` (`creator_id`),
  KEY `target_type_target_id_idx` (`target_type`,`target_id`),
  KEY `filename_idx` (`filename`),
  CONSTRAINT `media_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `media_chk_1` CHECK (json_valid(`metadate`))
) ENGINE=InnoDB AUTO_INCREMENT=331 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Медиаданные';
/*!40101 SET character_set_client = @saved_cs_client */;

