--
-- Table structure for table `messages`
--

DROP TABLE IF EXISTS `messages`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `messages` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `chat_id` bigint unsigned NOT NULL COMMENT 'Идентификатор чата',
  `creator_id` bigint unsigned NOT NULL COMMENT 'Автор сообщения',
  `body` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci COMMENT 'текс сообщения',
  `is_delivered` tinyint(1) DEFAULT NULL COMMENT 'Статус доставки',
  `is_read` tinyint(1) DEFAULT NULL COMMENT 'Статус получения)',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `messages_chat_id_fk` (`chat_id`),
  KEY `messages_creator_id_fk` (`creator_id`),
  CONSTRAINT `messages_chat_id_fk` FOREIGN KEY (`chat_id`) REFERENCES `chats` (`id`) ON DELETE CASCADE,
  CONSTRAINT `messages_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='таблица чатов';
/*!40101 SET character_set_client = @saved_cs_client */;

