  PRIMARY KEY (`id`),
  KEY `posts_unit_id_fk` (`unit_id`),
  KEY `posts_creator_id_fk` (`creator_id`),
  KEY `posts_category_id_fk` (`category_id`),
  CONSTRAINT `posts_category_id_fk` FOREIGN KEY (`category_id`) REFERENCES `post_categories` (`id`) ON DELETE SET NULL,
  CONSTRAINT `posts_creator_id_fk` FOREIGN KEY (`creator_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `posts_unit_id_fk` FOREIGN KEY (`unit_id`) REFERENCES `units` (`id`) ON DELETE CASCADE
